import React from 'react';

const Rank = ({name, entries}) => {
  return (
    <div>
      <div className='white f5'>
        {`${name}, your current rank is...`}
      </div>
      <div className='white f3'>
        {entries}
      </div>
    </div>
  );
}

  export default Rank;
